  return <div>PageOne</div>;
};

const pageTwo = () => {
  return <div>pageTwo</div>;
};

function App() {
  return (
    <div>
      <BrowserRouter>
        <Route path="/" exact />
      </BrowserRouter>
    </div>
  );
}

export default App;
